import React from 'react'

const Header = (props) => {
    return (
        <div>
            <nav className='navbar navbar-expand-lg bg-dark'>Task Tracker
                <li className="nav-item active" style={{listStyleType: "none"}}> <a style={{color:"white"}} href="/" class='nav-link'>Home</a></li>

            
            
            
            </nav>
            
        </div>
    )
}

export default Header
